import React from 'react';
import { Link } from 'react-router-dom';

const NavBar = () => {
  return (
    <div>
      <div className='logo'>
        <i class='fab fa-stripe'></i>
      </div>
      <div className='links'>
        <ul>
          <li>
            <Link to='/'>Home</Link>
          </li>
          <li>
            <Link to='/'>Shop</Link>
          </li>
          <li>
            <Link to='/'>Contact Us</Link>
          </li>
          <li>
            <Link to='/'>FAQs</Link>
          </li>
        </ul>
      </div>
    </div>
  );
};

export default NavBar;
